import { Link } from "react-router-dom";
import Heart from "../heart.png";
import * as styles from "./articleStyles";

const Article = ({ image, username, title, body, favoritesCount }) => {
  return (
    <ArticleContainer>
      <ArticleInfo>
        <ArticleMeta>
          <ImgContainer to="#">
            <AuthorImg src={image}></AuthorImg>
          </ImgContainer>
          <AuthorMetaContainer>
            <MetaName to="#">{username}</MetaName>
            <MetaDate>Thu Mar 04 2021</MetaDate>
          </AuthorMetaContainer>
        </ArticleMeta>
        <ArticleContent>
          <ArticleTitle>{title}</ArticleTitle>
          <ArticleBody>{body}</ArticleBody>
        </ArticleContent>
        <ReadMoreDiv>Read more...</ReadMoreDiv>
      </ArticleInfo>
      <LikeButton>
        <HeartIcon src={Heart}></HeartIcon>
        {favoritesCount}
      </LikeButton>
    </ArticleContainer>
  );
};

export default Article;
